import '../styles/main.scss'

const Links = (props) => {



  return (


      <li>
        <a tittle={props-tittle} class={props.class} href={props-href} target={props.openInNewTab ===true ? '_blank' : ''} rel="noreferrer">
          blog
        </a>
      </li>

  );
};

export default Links;
